INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "アヤネ", 24001, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 2, 102301, 401, 2, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "アヤネ", 24002, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 2.21, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 2, 102301, 402, 1, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "アヤネ", 24003, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 2, 102301, 403, 2, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "アサヒ", 24004, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1.99, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 1, 192201, 701, 2, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "アサヒ", 24005, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2.21, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 2, 192201, 702, 1, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "アサヒ", 24006, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 3.33, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 1, 192201, 703, 2, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "部員３", 24007, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 2, 192301, 801, 2, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "部員３", 24008, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2.68, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 2, 192301, 802, 1, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "部員３", 24009, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 2, 192301, 803, 2, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "", 24010, "やった！", 0.0, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 1, 192501, 501, 1, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "", 24011, "勝ったよ！", 0.0, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 1, 192501, 502, 1, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "", 24012, "いい調子！", 0.0, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 1, 192501, 503, 1, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "ミサト", 24013, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 5.33, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 2, 113501, 111, 6, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "ミサト", 24014, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 6.85, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 2, 113501, 112, 1, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "ミサト", 24015, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 3.0, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 2, 113501, 113, 1, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "ダイチ", 24016, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 6.11, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 2, 192401, 611, 1, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "ダイチ", 24017, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 6.75, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 2, 192401, 612, 1, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "ダイチ", 24018, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 2, 192401, 613, 2, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "ハツネ", 24019, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 4.52, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 1, 113401, 211, 2, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "ハツネ", 24020, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 3.89, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 1, 113401, 212, 2, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "ハツネ", 24021, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 13.49, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 2, 113401, 213, 1, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "カヤ", 24022, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 3.17, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 2, 106501, 311, 1, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "カヤ", 24023, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 4.42, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 2, 106501, 312, 1, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "カヤ", 24024, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 2.89, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 1, 106501, 313, 6, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "アヤネ", 24025, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 3.71, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 3, 102301, 421, 4, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "アサヒ", 24026, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 5.1, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 1, 192201, 721, 2, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "部員３", 24027, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 4.34, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 3, 192301, 821, 1, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, "", 24028, "いい勝負だったよ\nまたやろうね", 0.0, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 1, 192501, 521, 1, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (-360.0, "ミサト", 24029, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 5.62, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 2, 113501, 101, 1, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (-360.0, "ミサト", 24030, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 9.58, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 2, 113501, 102, 1, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (-360.0, "ミサト", 24031, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 2, 113501, 103, 2, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (-360.0, "ミサト", 24032, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 9.13, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 1, 113501, 104, 2, 10046);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (-360.0, "ミサト", 24033, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 8.27, 0.0, "2020/07/31 12:00:00", 24, "2030/12/17 14:59:59", 2, 113501, 105, 1, 10046);
